import React, { Component } from 'react';
import ReactBootstrap, {Container, Jumbotron, Button, Row, Col, Grid, Panel, FormGroup} from 'react-bootstrap'; 

class SearchFruits extends React.Component {
	render() {
	    return (
			<section class='p-3 sec-block search-fruits'>
				<Container>
					<h1>Search your Fruit</h1>
					<hr/>
					<form>
						<input 
							type='text'
							autocorrect='on'
							autofocus
						/>
					</form>
				</Container>
			</section>			  
	    )
	}
}

export default SearchFruits;
